/static/9536a4bd8496c96f9a1504d87ebcaa17/01478/image-hardware-d.png 1920w" alt="Your funds remain in your control"/></picture></noscript></div></div><div class="exodus__showcase__actions"><a class="x__button-default x__button-default--largest x__button-default--primary" tabindex="0" href="/security/"><span class="x__copy"><span>Secure and Trusted</span></span></a></div></div></section><section class="x__index-page__testimonials x__index-page__testimonials--no-arrows"><div class="x__index-page__testimonials__content" style="transform: translateX(-66.6667%); width: 300%;"><div class="exodus__testimonials-item"><div><p>Even if youre just starting out with Bitcoin or cryptocurrencies you would still be able to use this wallet effortlessly. Exodus is the kind of product you fall in love with the first time you use it, and thats quite rare in the cryptocurrency world.</p><a href="https://99bitcoins.com/bitcoin-wallet/exodus-review/" target="_blank" rel="noreferrer noopener"><img src="data:image/svg+xml;base64," alt="99Bitcoins logo"><span>99Bitcoins</span></a></div></div><div class="exodus__testimonials-item"><div><p>Exodus was built with beginning cryptocurrency users in mind, but is also ideal for most mainstream cryptocurrency enthusiasts who are looking for a secure, easy to use, beautiful wallet.</p><a href="https://www.coinbureau.com/review/exodus-wallet/" target="_blank" rel="noreferrer noopener"><img src="/static/coinbureau-ecc1ba3ffd5886570ccf1c33eeb7ede5.svg" alt="Coinbureau logo"><span>Coinbureau</span></a></div></div><div class="exodus__testimonials-item active"><div><p>With its simplicity, this wallet is great for beginners just getting into the crypto space. It also has great support, which is an essential feature for beginners getting into what many would consider a confusing market.</p><a href="https://www.investopedia.com/best-bitcoin-wallets-5070283#mntl-sc-block_2-0" target="_blank" rel="noreferrer noopener"><img src="data:image/svg+xml;base64," alt="In